declare enum Anchor {
    topLeft = "TopLeft",
    center = "Centre",
    centerLeft = "CentreLeft",
    topRight = "TopRight",
    bottomCenter = "BottomCentre",
    topCenter = "TopCentre",
    /**
     * The user is manually updating the outcome, so we shouldn't.
     */
    custom = "Custom",
    centerRight = "CentreRight",
    bottomLeft = "BottomLeft",
    bottomRight = "BottomRight"
}

